import React from 'react';

function Profile() {
    return (
        <div className="container d-flex justify-content-center align-items-center" style={{ minHeight: '100vh' }}>
            <div className="card p-4" style={{ width: '600px' }}>
                <h1 className="text-center mb-4">John Doe's Profile</h1>
                <div className="mb-3">
                    <p><strong>Username:</strong> <span className="badge bg-info">JohnDoe</span></p>
                </div>
                <div className="mb-3">
                    <p><strong>Email:</strong> <span className="badge bg-info">JohnDoe@test.com</span></p>
                </div>
                <div className="d-flex justify-content-center mt-4">
                    <a href="/edit-profile" className="btn btn-primary">Edit Profile</a>
                </div>
            </div>
        </div>
    );
}

export default Profile;
